info.description:
Typology: pronounced lozenge profile, but stop somewhat profuse now. no trace of decn. left on face or sides.
Manufacture: poss. small trace of orig. e. "[bev.]"
Condition: butt damaged - even extant corner is flat-filed; c. e. very blunt;

